import {Pokemon} from "../model/Pokemon";
import * as React from "react";

interface IProps {
    pokemonList: Pokemon[]
}

export function PokemonList(props: IProps) {

    return(
        <table>
            <tr>
                <th>
                    #
                </th>
                <th>
                    Name
                </th>
                <th>
                    Types
                </th>
                <th>
                    Weight
                </th>
            </tr>
            {props.pokemonList.map(pokemon => <li>{pokemon.name} {pokemon.id}</li>)}
        </table>
    )

}
